import React from 'react';
import Photo from './Photo';
import Lost from './Lost';

class PhotoContainer extends React.Component {

  state = {

  };

  render(){
    return (
      <div className="photo-container">
        <h2>Results</h2>
        <ul>
          {this.props.images.map( image =>
            <Photo 
              images={image.src}
              key={image.id}
              alt={image.alt}
            />
          )}
          <Lost />
        </ul>
      </div>
    );
  }
}

export default PhotoContainer;
